summary:
An investment fund is a way of investing money alongside other investors in order to benefit from the inherent advantages of working as part of a group such as reducing the risks of the investment by a significant percentage. These advantages include an ability to:

hire professional investment managers, who may offer better returns and more adequate risk management;
benefit from economies of scale, i.e., lower transaction costs;
increase the asset diversification to reduce some unsystematic risk.It remains unclear whether professional active investment managers can reliably enhance risk adjusted returns by an amount that exceeds fees and expenses of investment management. Terminology varies with country but investment funds are often referred to as investment pools, collective investment vehicles, collective investment schemes, managed funds, or simply funds.  The regulatory term is undertaking for collective investment in transferable securities, or short collective investment undertaking (cf. Law). An investment fund may be held by the public, such as a mutual fund, exchange-traded fund, special-purpose acquisition company or closed-end fund, or it may be sold only in a private placement, such as a hedge fund or private equity fund.  The term also includes specialized vehicles such as collective and common trust funds, which are unique bank-managed funds structured primarily to commingle assets from qualifying pension plans or trusts.Investment funds are promoted with a wide range of investment aims either targeting specific geographic regions (e.g., emerging markets or Europe) or specified industry sectors (e.g., technology). Depending on the country there is normally a bias towards the domestic market due to familiarity, and the lack of currency risk. Funds are often selected on the basis of these specified investment aims, their past investment performance, and other factors such as fees.

Make in India is an initiative by the Government of India to make and encourage companies to manufacture in India and incentivize dedicated investments into manufacturing. The policy approach was to create a conducive environment for investments, develop a modern and efficient infrastructure, and open up new sectors for foreign capital. The initiative targeted 25 economic sectors for job creation and skill enhancement, and aimed "to transform India into a global design and manufacturing hub.""Make in India" had three stated objectives:

to increase the manufacturing sector's growth rate to 12-14% per annum;
to create 100 million additional manufacturing jobs in the economy by 2022;
to ensure that the manufacturing sector's contribution to GDP is increased to 25% by 2022 (later revised to 2025).After the launch, India gave investment commitments worth ₹16.40 lakh crore (US$230 billion) and investment inquiries worth of ₹1.5 lakh crore (US$21 billion) between September 2014 to February 2016. As a result, India emerged as the top destination globally in 2015 for foreign direct investment (FDI), surpassing the United States and China, with US$60.1 billion FDI.
As per the current policy, 100% Foreign Direct Investment (FDI) is permitted in all 100 sectors, except for Space industry (74%), defence industry (49%) and Media of India (26%). Japan and India had also announced a US$12 billion 'Japan-India Make-in-India Special Finance Facility" fund to push investment.In line with the Make in India, individual states too launched their own local initiatives, such as 'Make in Odisha,' 'Tamil Nadu Global Investors Meet,' 'Vibrant Gujarat,' 'Happening Haryana' and 'Magnetic Maharashtra.' India received US$60 billion FDI in FY 2016–17.The World Bank's 2019 Ease of Doing Business report acknowledges India's jump of 23 positions against its rank of 100 in 2017 to be placed now at 63rd rank among 190 countries. By the end of 2017, India had risen 42 places on Ease of doing business index, 32 places World Economic Forum's Global Competitiveness Index, and 19 notches in the Logistics Performance Index, thanks to recent governmental initiatives, which include converges, synergies and enables other important Government of India schemes, such as Bharatmala, Sagarmala, Dedicated Freight Corridors, Industrial corridors, UDAN-RCS, Bharat Broadband Network, Digital India.
Make in India has not yet achieved its goals. The growth rate of manufacturing averaged 6.9% per annum between 2014–15 and 2019-20. The share of manufacturing dropped from 16.3% of GDP in 2014-15 to 15.1% in 2019-20.
